openapi: 3.0.3
info:
  title: rsk_rpc_methods v.0.9.0 (with apikey)
  description: |-
    Collection of RPC methods on RSK blockchain.  

    To use it, send the requests with your apikey in the path:

    `https://rpc.testnet.rootstock.io/{{your_apikey}}`

    `https://rpc.mainnet.rootstock.io/{{your_apikey}}`
  version: 1.0.0
  contact: {}
servers:
  - url: http://192.168.56.10:3005/json-rpc
paths:
  /{APIKEY}:
    post:
      summary: eth_accounts
      description: >-
        **method:** `eth_accounts`


        **response:** Returns a list of addresses owned by client. Since the
        application does not store private keys, this method will always return
        an empty array.


        **params:** none
      operationId: ethAccounts
      parameters:
