                    example: '2.0'
                  method:
                    type: string
                    example: eth_blockNumber
                  params:
                    type: array
                    items: {}
                    example: []
              example:
                - id: 2
                  jsonrpc: '2.0'
                  method: eth_blockNumber
                  params: []
                - id: 1
                  jsonrpc: '2.0'
                  method: eth_chainId
                  params: []
